		<div class="page-header">
						<h1>
															How to read a traceroute									</h1>
			
																
				
					<div style='font-size:12px; color:#aaa; margin-bottom:-10px; padding-top:5px;'>
							<div style='float:left; margin-right:20px;'><span style='color:#606060;'>Written by </span><a href='https://plus.google.com/u/0/103891980085974966828/?rel=author'>Scott Mitchell</a></div>
							<div style='float:left; margin-right:20px;'><span style='color:#606060;'>Views:</span> <span name='page_views' id='page_views'>63,956</span></div>
							<div style='float:left; margin-right:20px;' title='Originally published: May 29, 2014'><span style='color:#606060;'>Published:</span> Oct 1, 2015</div>
							<div style='float:left; margin-right:20px;'><span style='color:#606060;'>Comments:</span> <a href='#comments'>88</a></div>
							<div style='clear:both;'></div>
						</div>
						</div>
		
	
		

	

								<div class="in_this_tutorial">
  <h2>In this tutorial:</h2>
  <button type="button" class="btn btn-primary" onclick="trackAnchorClickSC('work');">How it works</button>
  <button type="button" class="btn btn-primary" onclick="trackAnchorClickSC('read');">Reading a traceroute</button>
  <button type="button" class="btn btn-primary" onclick="trackAnchorClickSC('contact');">Should I contact my hosting company?</button>
</div>

<p>There are times when it seems your website may respond slowly. Slow response time may indicate a problem. Most just assume the server is overloaded and call their technical support. Many times, the support representative will ask for a <a href="/support/website/slow-websites/why-is-my-server-slow-how-do-i-run-a-ping-and-tracert-test">ping and traceroute report</a>. While we have instructions on running this report, it can seem rather cryptic when looking at it.</p>

<p>It doesn't take a degree or any kind of special training to decode a traceroute report. In fact, we will teach you how in this article. This way, if you ever have slow response from your site, you can run a report and quickly determine whether you need to contact our <a href="/support/website/website-troubleshooting/how-to-get-great-technical-support">Live Support</a> team.</p>

<a name="work"></a>
 <h2>How a Traceroute works</h2>
 <p>Whenever a computer connects to a website, it must travel a path that consists of several points, a little like connecting the dots between your computer and the website. The signal starts at your local router in your home or business, then moves out to your ISP, then onto the main networks. From there it may have several junctions until it gets off the Internet highway at the local network for the website and then to the webserver itself.</p>

 <p>A traceroute displays the path that the signal took as it traveled around the Internet to the website. It also displays times which are the response times that occurred at each stop along the route. If there is a connection problem or latency connecting to a site, it will show up in these times. You will be able to identify which of the stops (also called 'hops') along the route is the culprit.</p>

<a name="read"></a>
<h2>How to read a Traceroute</h2>
<p>Once the traceroute is run, it generates the report as it goes along the route. Below is a sample traceroute:</p>
<pre class="cli">
C:\>tracert www.example.com
Tracing route to example.com [10.10.242.22]
over a maximum of 30 hops:

  1    <1 ms    <1 ms    <1 ms  172.16.10.2
  2     *        *        *     Request timed out.
  3     2 ms     2 ms     2 ms  vbchtmnas9k02-t0-4-0-1.coxfiber.net [216.54.0.29]
  4    12 ms    13 ms     3 ms  68.10.8.229
  5     7 ms     7 ms     7 ms  chndbbr01-pos0202.rd.ph.cox.net [68.1.0.242]
  6    10 ms     8 ms     9 ms  ip10-167-150-2.at.at.cox.net [70.167.150.2]
  7    10 ms     9 ms    10 ms  100ge7-1.core1.nyc4.he.net [184.105.223.166]
  8    72 ms    84 ms    74 ms  10gr10-3.core1.lax1.he.net [72.52.92.226]
  9    76 ms    76 ms    90 ms  10g1-3.core1.lax2.he.net [72.52.92.122]
 10    81 ms    74 ms    74 ms  205.134.225.38
 11    72 ms    71 ms    72 ms  www.inmotionhosting.com [192.145.237.216]
</pre>

<p>As you can see, there are several rows divided into columns on the report. Each row represents a "hop" along the route. Think of it as a check-in point where the signal gets its next set of directions. Each row is divided into five columns. A sample row is below:</p>
<pre class="cli">
10    81 ms    74 ms    74 ms  205.134.225.38
</pre>
<p>Let's break this particular hop down into its parts.</p>
<table class="article_table">
<tr>
<th>Hop #</th>
<th width="75">RTT 1</th>
<th width="75">RTT 2</th>
<th width="75">RTT 3</th>
<th>Name/IP Address</th>
</tr>
<tr>
<td>10</td>
<td>81 ms</td>
<td>74 ms</td>
<td>74 ms</td>
<td>205.134.225.38</td>
</tr>
</table>


<p><strong>Hop Number</strong> - This is the first column and is simply the number of the hop along the route. In this case, it is the tenth hop.</p>

<p><strong>RTT Columns</strong> - The next three columns display the round trip time (RTT) for your packet to reach that point and return to your computer. This is listed in milliseconds. There are three columns because the traceroute sends three separate signal packets. This is to display consistency, or a lack thereof, in the route. </p>

<p><strong>Domain/IP column</strong> - The last column has the IP address of the router. If it is available, the domain name will also be listed.</p>

<h3>Checking the hop times</h3>
<p>The times listed in the RTT columns are the main thing you want to look at when evaluating a traceroute. Consistent times are what you are looking for. There may be specific hops with increased latency times but they may not indicate that there is an issue. You need to look at a pattern over the whole report. Times above 150ms are considered to be long for a trip within the continental United States. (Times over 150ms may be normal if the signal crosses an ocean, however.) but issues may show up with very large numbers.</p>

<h3>Increasing latency towards the target</h3>
If you see a sudden increase in a hop and it keeps increasing to the destination (if it even gets there), then this indicates an issue starting at the hop with the increase. This may well cause packet loss where you will even see asterisks (*) in the report. 
<pre class="cli">
  1    10 ms     7 ms     9 ms  172.16.10.2
  2    78 ms   100 ms    32 ms  ip10-167-150-2.at.at.cox.net [70.167.150.2]
  3    78 ms    84 ms    75 ms  100ge7-1.core1.nyc4.he.net [184.105.223.166]
  4   782 ms   799 ms     * ms  10gr10-3.core1.lax1.he.net [72.52.92.226]
  5     * ms   899 ms   901 ms  10g1-3.core1.lax2.he.net [72.52.92.122]
  6   987 ms   954 ms   976 ms  205.134.225.38
  7  1002 ms  1011 ms   999 ms  www.inmotionhosting.com [192.145.237.216]
</pre>

<h3>High latency in the middle but not at beginning or end</h3>
<p>If the hop immediately after a long one drops back down, it simply means that the router at the long hop set the signal to a lower priority and does not have an issue. Patterns like this do not indicate an issue.</p>
<pre class="cli">
1  &lt;1 ms     &lt;1 ms       &lt;1 ms 173.247.246.116
2  30 ms      7 ms       11 ms 10.10.0.2
3 200 ms    210 ms      189 ms 4.71.136.1
4 111 ms     98 ms      101 ms ip10-167-150-2.at.at.cox.net [70.167.150.2]
5  99 ms    100 ms       98 ms  205.134.225.38
</pre>

<h3>High latency in the middle that remains consistent</h3>
<p>If you see a hop jump but remain consistent throughout the rest of the report, this does not indicate an issue.</p>
<pre class="cli">
1  &lt;1 ms     &lt;1 ms       &lt;1 ms 173.247.246.116
2  30 ms      7 ms       11 ms 10.10.0.2
3  93 ms     95 ms       92 ms 4.71.136.1
4  95 ms     99 ms      101 ms ip10-167-150-2.at.at.cox.net [70.167.150.2]
5  99 ms    100 ms       98 ms 100ge7-1.core1.nyc4.he.net [184.105.223.166]
6  95 ms     95 ms       95 ms 10g1-3.core1.lax2.he.net [72.52.92.122]
7  95 ms     96 ms       94 ms 205.134.225.38]
</pre>

<h3>High latency in the beginning hops</h3>
<p>Seeing reported latency in the first few hops indicates a possible issue on the local network level. You will want to work with your local network administrator to verify and fix it.</h3>

<h3>Timeouts at the beginning of the report</h3>
<p>If you have timeouts at the very beginning of the report, say within the first one or two hops, but the rest of the report runs, do not worry. This is perfectly normal as the device responsible likely does not respond to traceroute requests.</p>

<h3>Timeouts at the very end of the report</h3>
<p>Timeouts at the end may occur for a number of reasons. Not all of them indicate an issue, however.<br />
<ul>
<li>The target's firewall may be blocking requests. The target is still most probably reachable with a normal HTTP request, however. This should not affect normal connection.</li>
<li>The return path may have an issue from the destination point. This would mean the signal is still reaching, but just not getting the return signal back to your computer. This should not affect normal connection.</li>
<li>Possible connection problem at the target. This will affect the connection.</li>
</ul>


<a name="contact"></a>
<h2>Do I need to contact my hosting company?</h2>
<p>Once you have found a hop that seems to have an issue, you can identify its location and determine where the issue lies. It may be within your network, your ISP, somewhere along the route, or within your hosting provider's domain.</p>

<p>The first hop is within your own network. The next hop is your ISP. The last couple of hops are likely within your hosting providers' domain and control, so if the issue is there, they may be able to fix it for you. If it is anywhere prior to that, the issue is simply along the route and is within neither your nor your hosting provider's control.</p>

 
	
						 </div>

	






