						<div style='float:right;margin:0px 0px 15px 15px;font-size:12px;color:#aaa'>2015-12-30 11:52 am</div>
				                <div>Hello Nathalie,<br />
<br />
We're sorry to hear that you're having problems with your ISP (Internet Service Provider).  InMotion is a hosting service provider where our primary purpose is hosting websites, so we would depend on an Internet Service Provider like you so that our viewers can get to our servers through the internet.  If you look at your traceroute, and you do NOT get to your server, then there would be 100% packet loss - as the request from computer trying to access the data is not getting information back.  However, if you're getting some type of response - slow or not - then there some data flowing back and forth - meaning it's not 100% packet loss - at least for some periods of time.   To answer your question - no, rebooting your router does not change the route to get to your server.  This is determined beyond your router and through your ISP.   If there are problems with the latency getting to the hosting service, then you may want to contact your hosting service and provide them the trace routes you are seeing from your location.  They may be able to fix that for you by addressing the services connecting to the hosting service to provide connection to the internet.  If their services are performing normally, then it may be that you will need to talk with your ISP in order to determine why there is significant latency getting to URL in question.  <br />
<br />
I hope this helps to answer your question, please let us know if you require any further  assistance.<br />
<br />
Regards,<br />
Arnel C.</div>
