						<div style='float:right;margin:0px 0px 15px 15px;font-size:12px;color:#aaa'>2016-02-29 3:18 pm</div>
				                <div>Hello Liz,<br />
<br />
The traceroute you provided shows a definite problem at the 7th hop. From that point on, the signal is not getting through. The IP address there shows that the router with the problem is owned by Level3. They are a backbone company, think of them as an interstate highway, but the interNET version. <br />
<br />
Although you CAN contact Level 3 regarding your situation, it may be better to check and see if your ISP is having an issue with Level 3, or check to see if the hosting company is having an issue with them. Since Level 3 is closer to the hosting company in the trace, I would have them check first. It could possibly also be a firewall issue at the datacenter if Level 3 is feeding traffic to it. In cases like that, the majority of traffic can be fine, but for some reason your IP address may be blocked there. In that case, the hosting company may be able to get you unblocked.<br />
<br />
Sorry to hear you are having issues, but I hope it all gets worked out for you!<br />
<br />
Kindest Regards,<br />
Scott M</div>
